package week1;
import java.util.*;
public class Display {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a;
		boolean b;
		float c;
		double d;
		
		Scanner sc=new Scanner(System.in);
		
		a=sc.nextInt();
		b=sc.nextBoolean();
		c=sc.nextFloat();
		d=sc.nextDouble();
		
		
		System.out.println(a);
		System.out.println(b);
		System.out.println(c);
		System.out.println(d);
		
		sc.close();
	}

}
